import React from 'react'

import './Gamer.css'

const Gamer = props => {
    return (
        <li className="game_list_item">
            <h3 className="gamer_name">{props.name}</h3>
            <h4 className="cumulative_skore">total: </h4>
            <input type="text" className="current_skore_input"/>
            <img src="../../../public/green_tick.png" className="approval_icon"></img>
        </li>
    )
}

export default Gamer
